import { useState } from "react";
const Navbar = (props) => {
  const test = async () => {
    const response = await fetch(
      `https://api.themoviedb.org/3//movie/${props.inf.item.id}/videos?api_key=f847f42a3e8a3a8f665ef014755a6ca3`
    );
    const data = await response.json();
    console.log(data);
  };
  return;
};
export default Navbar;
